import React, { Component } from "react";
import logo from "./../img/logo.png";
const Header = () => {
  return (
    <header className="header">
      <div className="header__container container">
        <div className="header__logo">
          <img src={logo} />
        </div>
        <ul className="header__menu">
          <li> <a className="header__menu-item" href="#about">O nas</a></li>
          <li className="header__menu-item"><a href="#offer">Oferta</a></li>
          <li className="header__menu-item"><a href="#collaboration">Współpraca</a></li>
          <li className="header__menu-item"><a href="#contanct">Kontakt</a></li>
        </ul>
      </div>
    </header>
  );
};

export default Header;
